function displayGameOver() {
    textSize(48);
    fill(255, 0, 0);
    text("Game Over", width / 2 - 100, height / 2);

    let winner;
    if (oval1.energy >= 100 && oval2.energy >= 100) {
        winner = "It's a Tie!"; // If both players reach 100 energy simultaneously
    } else if (oval1.energy >= 100) {
        winner = "Player 1 Wins!";
    } else if (oval2.energy >= 100) {
        winner = "Player 2 Wins!";
    } else if (countdown <= 0) {
        // Determine the winner based on who has more energy when the timer runs out
        if (oval1.energy > oval2.energy) {
            winner = "Player 1 Wins!";
        } else if (oval1.energy < oval2.energy) {
            winner = "Player 2 Wins!";
        } else {
            winner = "It's a Tie!"; // Same energy for both players when the timer runs out
        }
    } else if (oval1.energy <= 0) {
        winner = "Player 2 Wins!"; // Player 1 ran out of energy
    } else if (oval2.energy <= 0) {
        winner = "Player 1 Wins!"; // Player 2 ran out of energy
    }

    textSize(32);
    fill(255);
    text(winner, width / 2 - 100, height / 2 + 50);
    text(`Final Energy - Player 1: ${oval1.energy}, Player 2: ${oval2.energy}`, width / 2 - 200, height / 2 + 100);

    // Play the game over sound
    gameOverSound.play();

    // Create and show the reset button
    let resetButton = createButton('Reset Game');
    resetButton.position(width / 2 - resetButton.width / 2, height / 2 + 150);
    resetButton.mousePressed(resetGame); // Attach the event handler
}

