// Gradient function for the background
function setGradient(x, y, w, h, c1, c2) {
    noFill();
    for (let i = y; i <= y + h; i++) {
        let inter = map(i, y, y + h, 0, 1);
        let c = lerpColor(c1, c2, inter);
        stroke(c);
        line(x, i, x + w, i);
    }
}
function drawHealthBar(x, y, width, height, energy) {
    let healthPercent = energy / 100;

    // Initialize colors inside the function
    let redColor = color(255, 0, 0);
    let greenColor = color(0, 255, 0);

    // Lerp color based on health percent
    let healthColor = lerpColor(redColor, greenColor, healthPercent);

    // Draw the background of the health bar (empty part)
    fill(50); // Dark grey color
    noStroke();
    rect(x, y, width, height);

    // Draw the filled part of the health bar
    fill(healthColor);
    rect(x, y, width * healthPercent, height);
}

function applyKnockback(oval, projectile) {
    let knockbackStrength = 10; // Adjust the strength of the knockback
    let angle = atan2(oval.y - projectile.y, oval.x - projectile.x);
    oval.x += knockbackStrength * cos(angle);
    oval.y += knockbackStrength * sin(angle);
}
function checkForBumping() {
    let d = dist(oval1.x, oval1.y, oval2.x, oval2.y);
    if (d < 40) { // Assuming 40 is the combined radius of two ovals
        applyKnockback(oval1, oval2);
        applyKnockback(oval2, oval1);
        oval1.energy = max(0, oval1.energy - 1);
        oval2.energy = max(0, oval2.energy - 5);
    }
}
function playerTwoControls() {
    // Rotate left with LEFT_ARROW
    if (keyIsDown(LEFT_ARROW)) {
        oval2.angle -= oval2.rotationSpeed;
    }
    // Rotate right with RIGHT_ARROW
    if (keyIsDown(RIGHT_ARROW)) {
        oval2.angle += oval2.rotationSpeed;
    }
    // Accelerate with UP_ARROW
    if (keyIsDown(UP_ARROW) && oval2.speed < oval2.maxSpeed) {
        oval2.speed += oval2.acceleration;
    }
    // Decelerate/reverse with DOWN_ARROW
    if (keyIsDown(DOWN_ARROW) && oval2.speed > -oval2.maxSpeed) {
        oval2.speed -= oval2.acceleration;
    }

    // Apply friction to gradually slow down when no movement keys are pressed
    if (!keyIsDown(UP_ARROW) && !keyIsDown(DOWN_ARROW)) {
        oval2.speed *= 0.98;
    }
}
class Plant {
    constructor(x, y) {
        this.x = x;
        this.y = y;
        this.size = 0;
        this.growing = true;
        this.maxSize = random(5, 10);
        this.age = 0;
    }

    update() {
        if (this.growing) {
            this.size += 0.1;
            if (this.size >= this.maxSize) {
                this.growing = false;
            }
        } else {
            this.age++;
        }
    }

    show() {
        // Breathing animation for plants
        let breathe = sin(frameCount / 60) * 0.5 + 1; // Sine wave for size oscillation
        let size = this.size * breathe;
        let alpha = map(this.age, 0, plantLifeSpan, 255, 0);
        
        fill(0, 255, 0, alpha);
        noStroke();
        ellipse(this.x, this.y, size, size);
    }

    isDead() {
        return this.age > plantLifeSpan;
    }
}

let projectiles = [];


class Projectile {
    constructor(x, y, angle, firedBy) {
        this.x = x;
        this.y = y;
        this.size = 5;
        this.speed = 5;
        this.angle = angle;
        this.firedBy = firedBy; // Reference to the oval that fired the projectile
    }


    update() {
        this.x += this.speed * cos(this.angle);
        this.y += this.speed * sin(this.angle);
    }

    show() {
        // Tail effect for projectiles
        stroke(255, 255, 0);
        strokeWeight(this.size);
        point(this.x, this.y);
    }
    hits(otherOval) {
        let d = dist(this.x, this.y, otherOval.x, otherOval.y);
        if (d < this.size / 2 + 20) { // Adjust the collision radius if needed
            projectileHitSound.play();
            return true;
        }
        return false;
    }

    hits(oval) {
        let d = dist(this.x, this.y, oval.x, oval.y);
        if (d < this.size / 2 + 20) {
                      projectileHitSound.play();
            return true;
        }
        return false;
    }
}

class Oval {
    constructor(x, y, r, g, b) {
        this.x = x;
        this.y = y;
        this.angle = 0;
        this.speed = 0;
        this.maxSpeed = 4;
        this.acceleration = 0.2;
        this.rotationSpeed = 0.1;
        this.color = { r, g, b };
        this.energy = 25; // Starting energy for each player
    }
    show() {
        push();
        translate(this.x, this.y);
        rotate(this.angle);

        // Glowing effect
        strokeWeight(4);
        stroke(255, 204, 0, 150);
        fill(this.color.r, this.color.g, this.color.b);

        ellipse(0, 0, 40, 20);
        pop();
    }

    update(controls) {
        if (controls === 'WASD') {
            if (keyIsDown(65)) { this.angle -= this.rotationSpeed; } // A key
            if (keyIsDown(68)) { this.angle += this.rotationSpeed; } // D key
            if (keyIsDown(87) && this.speed < this.maxSpeed) { this.speed += this.acceleration; } // W key
            if (keyIsDown(83) && this.speed > -this.maxSpeed) { this.speed -= this.acceleration; } // S key
        } else if (controls === 'ARROWS') {
            if (keyIsDown(LEFT_ARROW)) { this.angle -= this.rotationSpeed; }
            if (keyIsDown(RIGHT_ARROW)) { this.angle += this.rotationSpeed; }
            if (keyIsDown(UP_ARROW) && this.speed < this.maxSpeed) { this.speed += this.acceleration; }
            if (keyIsDown(DOWN_ARROW) && this.speed > -this.maxSpeed) { this.speed -= this.acceleration; }
        }

        // Apply friction to gradually slow down
        if (!keyIsDown(87) && !keyIsDown(83) && controls === 'WASD' ||
            !keyIsDown(UP_ARROW) && !keyIsDown(DOWN_ARROW) && controls === 'ARROWS') {
            this.speed *= 0.98;
        }

        // Move
        this.x += this.speed * cos(this.angle);
        this.y += this.speed * sin(this.angle);

        // Wrap around screen
        this.x = (this.x + width) % width;
        this.y = (this.y + height) % height;
    }

    eatPlant(plant) {
        let d = dist(this.x, this.y, plant.x, plant.y);
        if (d < 20 + plant.size / 2) {
            this.energy += 5; // Increase energy by 5 when a plant is eaten

            // Play the plant eating sound
            plantEatingSound.play();

            return true;
        }
        return false;
    }

    fire() {
        if (this.energy > 0) {
            let offsetDistance = 40; // Increase the offset distance
            let offsetX = offsetDistance * cos(this.angle);
            let offsetY = offsetDistance * sin(this.angle);
            let projectile = new Projectile(this.x + offsetX, this.y + offsetY, this.angle, this);
            projectiles.push(projectile);
            this.energy -= 1; // Firing a projectile costs energy
            // Play the fire sound
            fireSound.play();
        }
    }
}